import React from 'react'
import Timer from './Timer'
import { useNavigate } from 'react-router-dom';
import Question from './Question';

export function ButtonGenerator() {
    const buttons = () => {
        const row = [];
        for (var i = 1; i <=50; i++) {
            // row.push(<p key={i}>{i}</p>);
            row.push(<button className="btn btn-primary m-2" style={{ width: '45px' }} key={i}>{i}</button>);

        }
        return row;
    };

    return (
        <div>
            {
                buttons()
            }
        </div>
    );
}

export default function Exam() {
    const navigate = useNavigate();
    let onTimesup = () => {
        navigate("/");
    }

    return (

        <div>
            <header id="header" className="header fixed-top d-flex align-items-center">
                <div className="d-flex align-items-center justify-content-between">
                    <h4 style={{ color: 'white' }}>Web Programming Technology</h4>
                </div>
                <div className="header-nav ms-auto pe-5" >
                    <h4 style={{ color: 'white' }}>Time Left :  <Timer
                        onTimesup={onTimesup}
                        duration={3600}
                    /></h4>
                </div>
            </header>
            <main id="main" className="main" style={{ 'margin-right': '0px', 'margin-left': '20px' }}>

                <section className="section dashboard">
                    <div className="row">
 {/* Left side card */}
                        <div className="col-lg-8">
                            <div className="row">

                                <div className="col-12">
                                    <div className="card top-selling overflow-auto">

                                        <div className="card-body pb-0 overflow-auto" >
                                            <Question></Question>
                                            
                                            
                                            <div style={{ 'margin-top': '31%', 'margin-bottom': '03%', 'margin-left': '70%' }}>
                                                <button className="btn btn-primary" >Previous Question</button>
                                                <span style={{ 'margin-left': '5%' }}></span>
                                                <button className="btn btn-primary">Next Question</button>
                                            </div>
                                        </div>

                                    </div>
                                </div>


                            </div>
                        </div>

{/* Right side card */}
                        <div className="col-lg-4">
                            <div className="row">


                                <div className="col-12">
                                    <div className="card top-selling " >

                                        <div className="card-body pb-0" style={{'height':'720px' }}>
                                            <br />
                                            <h4 className="card-title" style={{ 'background-color': '#e1e1f3' }}>Student Name: Chandrakant Padme</h4>
                                            <h4 className="card-title" style={{ 'background-color': '#e1e1f3' }}>PRN No : 210945920064</h4>

                                            <hr />
                                            <h5 className="card-title" style={{ 'background-color': '#e1e1f3' }}>Questions </h5>

                                            <table className="table table-borderless">

                                            </table>
                                            <div style={{'overflow':'auto','height':'350px'}}>
                                           
                                            <ButtonGenerator></ButtonGenerator>
                                          </div>
                                            {/* <button className="btn btn-primary m-2" style={{ width: '45px' }} >1</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>2</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>3</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>4</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>5</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>6</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>7</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>8</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>9</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>10</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>11</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>12</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>13</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>14</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>15</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>16</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>17</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>18</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>19</button>
                                            <button className="btn btn-primary m-2" style={{ width: '45px' }}>20</button>
                                           */}
                                            <hr />
                                            
                                            <button className="btn btn-success" style={{'position':'absolute' ,'bottom':'35px'}}><a href="index.html" style={{ 'color': 'white', 'text-decoration': 'none' }}>Submit Exam</a></button>
                                            
                                            {/* <button className="btn btn-success" style={{ 'align':'bottom', 'margin-bottom': '6%' }}><a href="index.html" style={{ 'color': 'white', 'text-decoration': 'none' }}>Submit Exam</a></button> */}
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>

                </section>

            </main>


        </div>

    )
}
